import React from "react";

class App extends React.Component {
  render() {
    state = { resource: "posts" };
    return (
      <div className="ui container">
        <div>
          <button>Posts</button>
          <button>Todos</button>
        </div>
        {this.state.resource}
      </div>
    );
  }
}

export default App;
